window.bookSummaryJSON = "<p>The Gale family can change the world with the charms they cast, and they like to keep this in the family. Alysha Gale is tired of having all her aunts try to run her life, both personally and magically. So when the letter from her Gran arrives willing her a \"junk\" shop in Calgary, Alysha jumps at the chance. It isn't until she gets there that she realizes her customers are fey. And no one told her there's trouble brewing in Calgary - trouble so big that even calling in the family may not save the day.</p>"; 
